    console.log("test");
  };

  return (
    <span
      className={`${profileIconConstructor.wrapper} pl-5`}
      onClick={handleProfileIconClick}
    >
      <ProfileIcon type="primary" />
      <span className="text text_type_main-default">Личный кабинет</span>
    </span>
  );
}

export default ProfileIconConstructor;
